import React from 'react'

const ColumnNames = () => (
       
       <div>
            <span className={test}>Actions</span>
            <span>Map Name</span>
            <span>Team ID 1</span>
            <span>Team ID 2</span>
            <span>Attacking Team</span>
            <span>Warnings</span>
        </div>
)
        
export default ColumnNames;

test = {
    color: '#40C5FF'
}
